import './css/style.css';

function App() {
  return (
    <div className="App">
      <div className='container'>
        <div className='card'>
          <img src="test.png"/>
          <h1 className='title'>Продвижение веб-сайта в ТОП10</h1>
          <div className='desctiption'>Рекомендуем данный тариф всем типам сайтов, кроме интернет-магазинов. А интернет-магазинам рекомендуем продвижение по трафику.</div>
          <div className='subtitle'>от 100 000 Р</div>
          <a>Перейти</a>
        </div>
      </div>
    </div>
  );
}

export default App;
